import React from "react";

function Athlete({data}) {
    console.log(data.data.monday)
    return (
        <div className="Athlete">
            <h1>{data.data.name}</h1>
            <h2>{data.data.date}</h2>
            <h2>{data.data.data.monday.fatigue}</h2>
            <h3>{data.weeklyAverage}</h3>
        </div>
    )
}

export default Athlete;
